import LoginForm from '../../Components/Forms/Login'
//import RegisterForm from '../../Components/Forms/Registration'
import './login.css'

const Login = () => {

  useEffect(() => {
    const fetchUsers = async () => {
      const response = await fetch('http://localhost:4000/api/users')
    }
    fetchUsers()
  }, [])
  return (
    <div className='login'>
      <LoginForm />
      {/* <RegisterForm /> */}
    </div>
  )
}

export default Login
